import React from "react";
import Form from "react-bootstrap/Form";

type ImageUploadProps = React.DetailedHTMLProps<
  React.SelectHTMLAttributes<HTMLSelectElement>,
  HTMLSelectElement
> & { options: typeof Option[] } & HTMLSelectElement;

const ImageUpload = React.forwardRef<ImageUploadProps, {label: string}>(({label}, ref) => (
  <Form.Group>
    <Form.Label>Image Upload</Form.Label>
    <Form.File ref={ref}></Form.File>
  </Form.Group>
));

export default ImageUpload;
